/** 
 * Locates the asset from the classloader. <p> To allow plugins to bring its own assets without worrying about colliding with the assets in core, look for child classloader first. But to support plugins that get split, if the child classloader doesn't find it, fall back to the parent classloader.
 */
private @CheckForNull URL findResource(@NonNull String path) throws IOException {
  if (StringUtils.isBlank(path)) {
    return null;
  }
  if (path.contains(".."))   throw new IllegalArgumentException(path);
  String name;
  if (path.charAt(0) == '/') {
    name="assets" + path;
  }
 else {
    name="assets/" + path;
  }
  ClassLoader cl=Jenkins.class.getClassLoader();
  URL url=ClassLoaderReflectionToolkit._findResource(cl,name);
  if (url == null) {
    Enumeration<URL> e=cl.getResources(name);
    while (e.hasMoreElements()) {
      url=e.nextElement();
    }
  }
  return url;
}
